import React from 'react';

const ProfessionalsFilters = () => {

    return (
        <div className="ProfessionalsFiltersContainer">

            <div className="filterHeadingContainer">
                <p>Kies je professional</p>
            </div>

            <div className="filterIconsContainer">
                <div className="IconContainer"><h2>1</h2></div>
                <div className="IconContainer"><h2>2</h2></div>
                <div className="IconContainer"><h2>3</h2></div>
                <div className="IconContainer"><h2>4</h2></div>
                <div className="IconContainer"><h2>5</h2></div>
                <div className="IconContainer"><h2>6</h2></div>
                <div className="IconContainer"><h2>7</h2></div>
                <div className="IconContainer"><h2>8</h2></div>
            </div>

        </div>
    );

};

export default ProfessionalsFilters;
